import React from 'react'
import Axios from 'axios'

function Databases(){

    const [arrayData, setarrayData] = React.useState([]);

    React.useEffect(() => {
        try {
            Axios.get("/test").then((response) => {
                setarrayData(response.data.rows)
            })
        } catch (err){
            console.log(err);
        }
    }, [])

    return(
        <div>
            <h1>Databases</h1>
            <div>
                <table className='databaseData'>
                    {arrayData.forEach(ele =>{
                        return (<tr>
                            {ele.forEach(text => {
                                <td>{text}</td>
                            })}
                        </tr>)
                    })}
                </table>
            </div>
        </div>
    )
}

export default Databases;
